import React, { Component } from 'react';

class Login extends Component {
  state = {
    count:11
  };

  render() {
    return (
      <React.Fragment>

        <span>{this.formatCount()}</span>
        <button>Login</button>
      </React.Fragment>
    );
  }

  formatCount() {
    const {count} = this.state;

    return count === 0? 'Zero':count;
  }
}



export default Login;
